import logo from './logo.svg';
import {Link, Outlet} from "react-router-dom";
import {useEffect, useState} from 'react';
import Appbar from "./components/Appbar";
import { Toolbar } from '@mui/material';
import './App.css';

function App() {
  return (
    <div>
    <Appbar position='fixed'>
    <Toolbar>
    <Outlet/>
    </Toolbar>  
    </Appbar>
    </div>
  );
}

export default App;
